import React from "react";
import RadioContext from "./radioContext";
function RadioGroup({ label, children }) {
    return (
      <fieldset>
        <legend>{label}</legend>
        {children}
        <RadioContext.Provider value={rest}>{children}</RadioContext.Provider>
      </fieldset>
    );
  }

  export default RadioGroup;
